import React from "react";
import './styles.css'
import midBlob from '../../ComingSoon/midBlob.png'
import blobLRight from '../../ComingSoon/BlobRight1.png'
export const Home = () => {
    return (
        <main className="home-page">
            <div className='midBlob-img'>
                <img src={midBlob} />
            </div>
            <div className='blobRight-img'>
                <img src={blobLRight} />
            </div>

        </main>

    )

}
